export const getRandomWord = () => {
  return WORDS_LIST[Math.floor(Math.random() * WORDS_LIST.length)];
};

// Função para verificar se a palavra existe na lista
export const isValidWord = (word) => {
  return WORDS_LIST.includes(word);
};
// Função auxiliar para limpar acentos (AÇÃO -> ACAO)
const removeAccents = (str) => {
  return str.normalize("NFD").replace(/[\u0300-\u036f]/g, "").toUpperCase();
};


// Nova função: Procura a palavra e retorna ela COM O ACENTO original
export const getWordFromList = (word) => {
  const wordClean = removeAccents(word);
  // Encontra a palavra na lista cuja versão limpa seja igual ao que foi digitado
  return WORDS_LIST.find(w => removeAccents(w) === wordClean);
};

